import React from "react";
import './Visualization.css';
import "@fontsource/red-hat-display";
import './../min.css';
import visualizationBackground from "./resources/display-background.svg";
function Display(){
    return(
        <div className="body-visulization">

            <div style={{align:'left',"z-index":4}}>
                <div className="heading-text-h2" style={{"margin-bottom":"20px"}}>Visualization and</div>
                <div className="heading-text-h2" style={{"margin-bottom":"20px"}}>Data Intelligence</div>
                <div className="heading-text-h2 underline" style={{color: "#FFC400","margin-bottom":"20px"}}>Come Alive</div>
                <div className="source-button">Open Source Library</div>
            </div>
            <div className="visualiztion-heading">
                <img src={visualizationBackground} style={{width:'100%'}}/>
            </div>

        </div>
    );


}
export default Display;
